import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Link, useNavigate } from 'react-router-dom';
import { checkIsAuth, registerUser } from '../redux/features/authSlice';
import { toast } from 'react-toastify';

import { useForm } from 'react-hook-form';
import { ExclamationTriangleIcon } from '@heroicons/react/24/solid';

import logo from '../assets/main/Logo.svg';
import avatar_registration from '../assets/main/avatar_registration.svg';


const Registration = () => {
    const {
        register,
        handleSubmit,
        watch,
        formState: { errors }
    } = useForm();

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [fullName, setFullName] = useState('');
    const [city, setCity] = useState('');
    const [picturePath, setPicturePath] = useState();

    const dispatch = useDispatch();
    const navigate = useNavigate();

    const isAuth = useSelector(checkIsAuth);
    const { status } = useSelector(state => state.auth);

    useEffect(() => {
        if (status) toast(status);
        if (isAuth) navigate('/');
    }, [status, isAuth, navigate]);

    const handleSubmitForm = () => {
        try {
            dispatch(registerUser({ email, password, fullName, city, picturePath }));
            setEmail('');
            setPassword('');
            setFullName('');
            setCity('');
        } catch (e) {
            console.log(e);
        }
    }

    return (
        <section className='flex flex-col min-h-screen bg-white py-3 px-5 text-2xl font-roboto font-extralight'>
            <div className="logo">
                <img className='w-16 h-16' src={logo} alt="logo" />
            </div>

            <div className="flex-1 flex justify-center items-center pb-28">
                <form
                    className='flex flex-col items-center gap-7'
                    onSubmit={e => e.preventDefault()}
                >
                    <h1>Регистрация</h1>

                    <img src={avatar_registration} alt="avatar_registration" />

                    <div className='flex flex-col gap-9'>
                        <div className='border border-b-[2px] border-t-0 border-l-0 border-r-0 border-b-gray-200'>
                            <input
                                {...register('fullName', {
                                    required: true,
                                    maxLength: 50,
                                    pattern: /^[а-яА-Яa-zA-Z]+$/
                                })}
                                type="text"
                                placeholder='Логин'
                                value={fullName}
                                onChange={e => setFullName(e.target.value)}
                                className='placeholder:text-light-gray placeholder:text-xl placeholder:text-center placeholder:opacity-40 focus:outline-none'
                            />
                        </div>

                        <div className='border border-b-[2px] border-t-0 border-l-0 border-r-0 border-b-gray-200'>
                            <input
                                {...register('email', {
                                    required: true,
                                })}
                                type="email"
                                placeholder='Email'
                                value={email}
                                onChange={e => setEmail(e.target.value)}
                                className='placeholder:text-light-gray placeholder:text-xl placeholder:text-center placeholder:opacity-40 focus:outline-none'
                            />
                        </div>

                        <div className='border border-b-[2px] border-t-0 border-l-0 border-r-0 border-b-gray-200'>
                            <input
                                {...register('password', {
                                    required: true
                                })}
                                type="password"
                                placeholder='Пароль'
                                name="password"
                                value={password}
                                onChange={e => setPassword(e.target.value)}
                                className='placeholder:text-light-gray placeholder:text-xl placeholder:text-center placeholder:opacity-40 focus:outline-none'
                            />
                        </div>

                        <div className='border border-b-[2px] border-t-0 border-l-0 border-r-0 border-b-gray-200'>
                            <input
                                {...register('city', {
                                    required: true,
                                    maxLength: 50,
                                    pattern: /^[а-яА-Яa-zA-Z]+$/
                                })}
                                type="text"
                                placeholder='Город'
                                value={city}
                                onChange={e => setCity(e.target.value)}
                                className='placeholder:text-light-gray placeholder:text-xl placeholder:text-center placeholder:opacity-40 focus:outline-none'
                            />
                        </div>

                    </div>

                    <div className="flex flex-col gap-3">
                        <Link
                            className='text-base text-center text-light-blue'
                            to="/login"
                        >
                            Уже зарегистрирован?
                        </Link>

                        <button
                            className='text-xl px-8 py-[6px] text-white bg-medium-blue'
                            onClick={handleSubmitForm}
                            type='submit'
                        >
                            Зарегистрироваться
                        </button>
                    </div>
                </form>
            </div>


        </section>

    )
}

export default Registration
